import React from "react";

export const Footer = () => {
  return (
    <footer className="flex p-5">
      <div className="">
        <h2 className="text-green-500 text-4xl text-start font-semibold">
          <a href="/#">MovieDB</a>
        </h2>
      </div>
      <div>
        <p>Made with React | Clement</p>
      </div>
    </footer>
  );
};

export default Footer;
